import React from "react";

import "../../index.css";
import LandingPageNavbar from "./sections/LandingPageNavbar";

import Me from "../../assets/me.jpeg";
import { Col, Row, Card } from "react-bootstrap";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div>
      <LandingPageNavbar />
      <div className="container " style={{ marginTop: "130px" }}>
        <div className="full">
          <Row className="">
            {/* <Col md="8">
              <h2 className="h2-responsive mt-3 mb-2">404. That's an error.</h2>
              <h4>The requested URL was not found on this server.</h4>
            </Col> */}
            <Col md="4">
              <div
                className="bg-info"
                style={{
                  borderTopLeftRadius: "50px",
                  borderBottomLeftRadius: "50px"
                }}
              >
                <img
                  alt="hello"
                  className="img-fluid p-1"
                  src={Me}
                  style={{
                    borderTopLeftRadius: "50px",
                    borderBottomLeftRadius: "50px"
                  }}
                />
              </div>
            </Col>
            <Col>
              <Card border="info" className="text-center">
                <Card.Body><h2>Hello, I am Amirreza </h2></Card.Body>
              </Card>
            </Col>
          </Row>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
